import Signin from './Signin';
import Signup from './Signup';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <Router>
      <Routes>
        <Route path='/' element={<Signup />} />
        <Route path='/Signin' element={<Signin />} />
      </Routes>
    </Router>
  );
}

export default App;
